import React, { Component } from "react";

class BackgroundWriteup extends Component {
  state = {};
  render() {
    return (
      <div className="container ">
        <h1 className="text-4xl text-gray-600 m-10">Background:</h1>
        {this.props.children}
      </div>
    );
  }
}

export default BackgroundWriteup;
